import React from 'react'
import StackSidebar from './StackSidebar';
import StackSidebarMain from './StackSidebarMain';
import './StackSidebar.css';
const Index = () => {
  return (
    
    <div className='stackIndex'>
        <div className='stackIndexContent'>
            
            <StackSidebar/>
            <StackSidebarMain/>
        </div>
    </div>
  )
}

export default Index
